Kris goes to the kitchen and finds it a complete messy disaster, made by his dad's girlfriend, Katie. He calls her to the kitchen and gives her a piece of his mind, asking her to clean up the mess she left. But claiming she's not good at house chores, Katie makes up for it by giving Kris a piece of something, too ...
